import styled from 'styled-components';

export const BoardRow = styled.div`
  :after {
    clear: both;
    content: '';
    display: table;
  }
`;
BoardRow.displayName = 'BoardRow';

export const Status = styled.div`
  margin-bottom: 10px;
`;
Status.displayName = 'Status';
